import React, {useState, useEffect} from 'react';
import { getBlogEntries } from './BlogQueries';
import AddBlogEntryForm from './AddBlogEntryForm';

const BlogEntries = () => {

    let [blogEntries, setBlogEntries] = useState([{id: 100, title: "ta", content: "da", img_link: ""}]);
    
    const addNewEntry = e => {
        setBlogEntries(...BlogEntries, e);
    }

    useEffect(()=>{
        getBlogEntries().then(res => setBlogEntries(res));
        console.log(blogEntries);
    });

    return(
        <div>
            <AddBlogEntryForm addNewEntry={addNewEntry} />
            {blogEntries.map(e => {
                <p>{e.title}</p>
            })}
        </div>
    );
}

export default BlogEntries;
